				$key5 = ExpositorFeriaPeer::getPrimaryKeyHashFromRow($row, $startcol5);
				if ($key5 !== null) {
					$obj5 = ExpositorFeriaPeer::getInstanceFromPool($key5);
					if (!$obj5) {
	
						$cls = ExpositorFeriaPeer::getOMClass(false);

					$obj5 = new $cls();
					$obj5->hydrate($row, $startcol5);
					ExpositorFeriaPeer::addInstanceToPool($obj5, $key5);
				} // if $obj5 already loaded

				// Add the $obj1 (PagoExpositor) to the collection in $obj5 (ExpositorFeria)
				$obj5->addPagoExpositor($obj1);

			} // if joined row is not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
	}

