	public static function retrieveByPK($pk, PropelPDO $con = null)
	{

		if (null !== ($obj = PagoExpositorPeer::getInstanceFromPool((string) $pk))) {
			return $obj;
		}

		if ($con === null) {
			$con = Propel::getConnection(PagoExpositorPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$criteria = new Criteria(PagoExpositorPeer::DATABASE_NAME);
		$criteria->add(PagoExpositorPeer::ID, $pk);

		$v = PagoExpositorPeer::doSelect($criteria, $con);

		return !empty($v) > 0 ? $v[0] : null;
